import React from 'react'
import { Tabs,Button } from 'antd';
import { Rate } from 'antd';
import { Card } from 'antd';

export default function demo() {
    const { TabPane } = Tabs;

    const onChange = (key) => {
        console.log(key);
    };
    const { Meta } = Card;

    return(
        <div className='list_table' style={{ padding: '50px',height:'600px'}}>
            <Tabs defaultActiveKey="1" onChange={onChange}>
                <TabPane tab="欧美专区" key="1">
                    <div style={{marginLeft:'0px'}}><Button>最新</Button><Button>最热</Button><Button>好评</Button></div>
                    <div className='camera' style={{height:'400px',width:'200px',float: 'left',paddingRight:'3px',paddingTop:'5px'}}>
                    <Card
                        hoverable
                        style={{
                            width: 200,
                        }}
                        cover={<img alt="example" src="https://image11.m1905.cn/uploadfile/2014/0411/thumb_1_150_203_20140411110232916137.jpg" />}
                    >
                        <Meta title="《伯爵夫人》" description="伏地魔情牵妇人" />
                    </Card>
                    </div>
                    <div className='camera' style={{height:'400px',width:'200px',float: 'left',paddingRight:'3px',paddingTop:'5px'}}>
                    <Card
                        hoverable
                        style={{
                            float:'left',
                            width: 200,
                        }}
                        cover={<img alt="《刺客信条》" src="https://image11.m1905.cn/uploadfile/2017/0221/thumb_1_150_203_20170221113306857592.jpg" />}
                    >
